// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract CurveDepositWithdraw {
    address public curvePool; // Address of the Curve pool contract
    address public owner; // Address of the contract owner
    address public Treasury;
   

    constructor(address _curvePool,address _treasury) {
        curvePool = _curvePool;
        Treasury = _treasury;
    }

    // Function to deposit tokens into the Curve pool
    function deposit(address tokenAddress, uint256 amount) public  {
        // Ensure the token contract is approved to spend the specified amount
        IERC20(tokenAddress).transferFrom(msg.sender, address(this), amount);
        IERC20(tokenAddress).approve(curvePool, amount);

        // Deposit tokens into the Curve pool
        require(ICurvePool(curvePool).add_liquidity([amount, 0, 0], 0), "Deposit failed");
    }

    // Function to withdraw tokens from the Curve pool
    function withdraw(address tokenAddress, uint256 amount) public  {
        // Withdraw tokens from the Curve pool
        ICurvePool(curvePool).remove_liquidity_one_coin(amount, 0, 0);

        // Transfer the withdrawn tokens to the contract owner
        IERC20(tokenAddress).transfer(owner, amount);
    }

    // Function to get the contract's balance of a specific token
    function getBalance(address tokenAddress) public view returns (uint256) {
        return IERC20(tokenAddress).balanceOf(address(this));
    }
}

interface ICurvePool {
    function add_liquidity(uint256[3] calldata amounts, uint256 min_mint_amount) external returns (bool);
    function remove_liquidity_one_coin(uint256 token_amount, int128 i, uint256 min_amount) external returns (uint256);
}

